import './App.css';
import Header from './components/layouts/header.js';
import Form from './components/Form';
import Table from './components/TablePayment';

import {useEffect, useState} from 'react';



function App() {
  //create a state at top level so that it can be pass on to children component
  //this is prop that will be passed on.

  const [data, setData] = useState([])


  return (
    <div className="App">
      <Header />
      {/* Here we set the data state and pass it on */}
      <Form  setData={setData} data={data}/>

      {/* Here the data from top level will passes on */}


    </div>
  );
}

export default App;
